svg.script:
const nets = {};
let i = 0
for(const e of document.querySelectorAll('.cu path')){
    const k = e.dataset.net = Object.keys(nets).length;
    nets[k] = document.querySelectorAll('.'+e.className.animVal);
}
for(const e of document.querySelectorAll('.cu path')){
    e.onmouseover = (e => {
        for(const f of nets[e.target.dataset.net]) f.classList.add('x');
    })
    e.onmouseout = (e => {
        for(const f of nets[e.target.dataset.net]) f.classList.remove('x');
    })
}
